C(c,H(yd));c.a.a+="'> <h3>Changelog</h3> <p>9/27/2012</p> <ul> <li>New UI</li> <li>Migration to GWT 2.5 RC</li> <li>Migration to extensions manifest version 2</li> <li>Optimized XML nad JSON view renderer using web workers and optymizing regular expressions</li> <li>Added save to file and \"copy\" function to response view.</li> <li>Deprecated server import/export</li> <li>Added file export and import</li> <li>Implemented new Chrome APIs: webRequest, declarativeWebRequest and storage</li> <li>Move part of request functionality to the bacground page to set declarativeWebRequest filter before request</li> <li>Integration with other extensions providing API to set request data in application via extensions passage massing or via web intents</li> <li>Now background page removes almost all default browser's headers not set by user.</li> <li>Database structure and local storage keys has changed.</li> <li>Links in response view now changing URL value in request view.</li> <li>Added chrome.synch API to synch user settings</li> <li>Fixed <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=57'>Issue 57</a>: Application have new \"save request\" system. User can link requests into project and switch between overwriting selected data.</li> <li>Fixed <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=62'>Issue 62</a>: Now application can set all request headers (even prohibited by XMLHttpRequest spec)</li> <li>Fixed <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=67'>Issue 67</a>: Application now can show redirect information.</li> <li>Fixed <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=68'>Issue 68</a>: Payload is set in request when using custom \"method\"</li> <li>Fixed <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=70'>Issue 70</a> and <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=73'>Issue 73</a>: Application now wil not set Content-Type header fon non-payload requests</li> </ul> <p>8/4/2012</p> <ul> <li>Added detailed view to Request URL section (hover URL sign)</li> <li> Fixed <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=54'>Issue 54</a> : Auto-complete prevents \"enter\" on parent path of previous entry </li> <li> Fixed <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=55'>Issue 55</a> : Content-Type is set by Default (application/x-www-form-urlencoded), but should not be </li> <li>Added server request \"X-Chrome-Extension\" header to prevent eneter some URLs outside extension</li> </ul> <p>3/29/2012</p> <ul> <li> Fixed <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=50'>Issue 50</a> : Cannot remove file from body </li> <li> Fixed <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=51'>Issue 51</a> : XML Body has collapse/expand arrows, but they do not work </li> <li> Fixed <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=53'>Issue 53</a> : Cannot save Content-Type header </li> </ul> </section>";
